import "bootstrap/dist/css/bootstrap.min.css";
import { Navbar, Container, Nav } from "react-bootstrap";
import { useNavigate } from "react-router-dom";

function Navbars() {
  let navigate = useNavigate();
  return (
    <Navbar
      style={{ background: "#162542", paddingTop: "1rem" }}
      variant="dark">
      <Container>
        <Navbar.Brand
          onClick={() => {
            navigate("/");
          }}>
          <img
            alt="logo"
            src="logo_white.png"
            style={{ height: "1.5rem", marginRight: "1rem" }}
          />
          블루플랜트
        </Navbar.Brand>
        <Nav className="me-auto">
          <Nav.Link
            onClick={() => {
              navigate("/info");
            }}>
            Info
          </Nav.Link>
          <Nav.Link
            onClick={() => {
              navigate("/portfolio");
            }}>
            Portfolio
          </Nav.Link>
        </Nav>
      </Container>
    </Navbar>
  );
}
export default Navbars;
